import React from 'react';
import { useParams } from 'react-router-dom';
import fakeData from '../fakeData/operators.json';

const Payment = () => {
  let { id } = useParams();
  let user = fakeData.find((item) => item.id == { id });

  return <div>{user.name}</div>;
};

export default Payment;
